How to get all reviews of a product using nodejs<p>I am creating a e-commerce app and now I want to get all the review of a product using nodejs and database is mongoDB (using mongoose). This is my Schemas:</p>
<p>User Schema:</p>
<pre><code>const userSchema = new Schema(
  {
    name: { type: String, required: true },
    email: { type: String, required: true, unique: true },
    password: { type: String, required: true },
    isAdmin: { type: Boolean, required: true, default: false },
  },
  {
    timestamps: true,
  }
);
</code></pre>
<p>Product Schema:</p>
<pre><code>const productSchema = new Schema({
  user: {
    type: Schema.Types.ObjectId,
    required: true,
    ref: &quot;users&quot;,
  },
  name: { type: String, required: true },
  image: { type: String, required: true },
  brand: { type: String, required: true },
  category: { type: String, required: true },
  description: { type: String, required: true },
  reviews: [
    {
      name: { type: String, required: true },
      rating: { type: Number, required: true },
      comment: { type: String, required: true },
      user: {
        type: Schema.Types.ObjectId,
        required: true,
        ref: &quot;users&quot;,
      },
    },
    {
      timestamps: true,
    },
  ],
  rating: { type: Number, required: true, default: 0 },
  reviewNumber: { type: Number, required: true, default: 0 },
  price: { type: Number, required: true, default: 0 },
  countInStock: { type: Number, required: true, default: 0 },
});
</code></pre>
<p>I want to get all reviews of a product. It's my controller</p>
<pre><code>//* desc   Get all reviews
//* route  GET /product/:id/review
//* access Public
const getAllReviews = async (req, res) =&gt; {
  try {
    const product = await Product.findById(req.params.id);
    const reviews = product.reviews.find({});
    return res.status(200).json({
      success: true,
      reviews,
    });
  } catch (error) {
    console.log(error);
    return res.status(500).json({
      success: false,
      message: &quot;Internal server error&quot;,
    });
  }
};
</code></pre>
<p>But when I test by using Postman. The result is error 500. How can I get all review?</p>
